function ApplyDetailsSettings()
	local addon = "Details"

	if not Utils.RequireAddon(addon) then
		return
	end

	local profileName = Utils.GetProfileName()

	local settings = GetDetailsSettings()

	_detalhes:ImportProfile(settings, profileName)

	if _detalhes:GetCurrentProfileName() ~= profileName then
		_detalhes:ApplyProfile(profileName)
	end

	_detalhes.always_use_profile = true
	_detalhes.always_use_profile_name = profileName

	Utils.LoadComplete(addon, profileName)
end
